import Header from '../'
import Footer from '../components/Footer'
import './Loading.css';

const Loading = () => {
    return (
        <div>
            <Header />

            <main>
                <div className="loading"></div>
            </main>
            <Footer />
        </div>
    )
}

export default Loading;
